      | 365352 -> { ItemTypeData.id= 365352; name= "Surge Carapace II"; published= false; description= "Surge modules create a brief, incredibly strong protective shell around a vehicle by instantly diverting a massive amount of charge from the vehicle's on-board capacitor to the vehicle's hull.    These modules are exceedingly effective at countering lock-on weaponry when activation is timed correctly.    Note: Only one module of this type can be equipped at one time."; marketGroupId= None; groupId= 351121; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 365449 -> { ItemTypeData.id= 365449; name= "Ishukone Assault Rail Rifle"; published= false; description= "Part of Kaalakiota’s Stahl line of weaponry, the rail rifle is a fast-firing precision weapon designed for field operations where penetrative power and range are paramount. Developed using the corporation’s proprietary microscale technology, the rail rifle solves oversaturation issues endemic to sustained fire electromagnetic weaponry.  However, its greater range and power are offset by a smaller magazine capacity and lower rate of fire than similarly classified weapons.    The foregrip design aids stabilization and remains cool to the touch even during prolonged discharge where the barrel can exceed mean operating temperatures. Featuring a reinforced subassembly and compact, heavy-barrel design, the rail rifle is the premier fully automatic microscale weapon available today."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365934 -> { ItemTypeData.id= 365934; name= "'Wolfman' Assault A/1-Series"; published= false; description= "NOTE: In addition to pre-requisite skills, this pre-fitted dropsuit requires PG/CPU optimization skills to be trained in order to be used.    The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.    A hydra-membrane graft directly integrates the suit with the wearer’s neurological system. While painful, this neuromorphic interface improves processing speed and reaction time while also allowing the suit to draw a limited, renewable supply of energy from the wearer’s body, which in turn can be applied to reinforce shield systems or augment overall power output. Aesthetics are a vital aspect of the suit’s design, because to the Amarr, aesthetics are function. Enshrined within the armor, the wearer becomes a vessel, the embodiment of God’s will and an instrument of holy wrath, unmistakable, and feared, by all who look upon him. To the Amarr, the dropsuit itself is the weapon.    Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366322 -> { ItemTypeData.id= 366322; name= "Republic Basic CPU Upgrade"; published= false; description= "Increases dropsuit's maximum CPU output.    NOTE: Stacking penalties apply to this module; the effectiveness of each additional module (after the first) that alters the same attributes will be reduced. "; marketGroupId= None; groupId= 351121; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 366419 -> { ItemTypeData.id= 366419; name= "Imperial Logistics A/1-Series"; published= false; description= "The Logistics dropsuit is outfitted with the latest in integrated diagnostic technology, most of which revolves around maintaining the condition and efficiency of squad mates and their equipment. As such, a soldier equipped with this class of dropsuit becomes a force multiplier, greatly improving the overall effectiveness of the unit.    The Amarr variant is a durable, combat-focused suit that provides above-average protection, allowing logistic units to operate in the middle of a firefight, actively dispersing aid and support as needed while simultaneously engaging the enemy and inflicting trauma of its own.    When deployed, a soldier equipped with a Logistics suit fills a vital tactical role in small unit operations and full-scale warfare, providing both, medical and mechanical support."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366516 -> { ItemTypeData.id= 366516; name= "State AT-201 Missile Launcher"; published= false; description= "Missile launcher tech is comparatively unsophisticated. It's the missiles themselves and the supplementary tracking, targeting, and guidance systems comprising the delivery system that make missiles such deadly ordnance. "; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366710 -> { ItemTypeData.id= 366710; name= "Commando C/1-Series"; published= false; description= "The Commando dropsuit is a variable combat unit capable of reacting to battlefield threats as they emerge. Built using a repurposed heavy frame, the suit is designed for maximum offensive flexibility. The streamlined frame does away with extraneous armor layers, using the augmented power of the exoskeleton to instead shoulder the weight and bulk of two light-class weapons.    Utilizing technologies sourced from across the State, the Commando’s subframe is hardwired with custom-built damage modifiers that enhance the output of all light-class railgun weaponry synched with the suit’s core operating system. This is achieved, in part, by managing the weapon’s charge efficiency in order to ensure maximum impact of every discharge.    The Commando is the ultimate suppression fighter. What the suit sacrifices in tactical versatility, it more than makes up for with flexible weapon loadouts that can counter any of the myriad threats an ever-evolving battlefield may present."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
